  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:12.903461\",\n\t\"name\": \"ruby-lake-national-wildlife-refuge-ruby-valley-nevada-1995-annual-water-management-report-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Overall, 1995 was a very wet year with
  18.72 inches of precipitation recorded at Refuge headquarters. Near or above normal
  precipitation has occurred during three of the last four years. Normal or above
  normal spring flows occurred during the year. The South Marsh reached objective
  level on 1 July and by the end of the year was only 1.08 inches below objective
  level (5964.75). The water availability forecast for 1996 is very encouraging. The
  early part of winter was mild and dry, but above average amounts of precipitation
  have fallen during January and February. The snow pack water content in the south
  Ruby Mountains as of 1 February was 104.7 percent of normal. As of 15 February the
  elevation of the South Marsh was 5965.26 which is 6.12 inches above objective level.
  It is expected that there will be water available to maintain objective elevations
  in the West Marsh Units, the South Marsh, and the North Marsh.\",\n\t\"license_title\":
